import React from 'react';
import PaidNavbar from './PaidNavbar';
import Footer from './Footer'; // Assuming you want to keep the footer on this page as well
import './Diary.css'; // Create and style this CSS file as needed

const Diary = () => {
    return (
        <div>
            <PaidNavbar />
            <div className="diary-content">
                <h1>Diary</h1>
                {/* Add the content and functionality for the Diary page here */}
            </div>
            <Footer />
        </div>
    );
}

export default Diary;
